INSERT INTO `biz_question` VALUES (102, 'typing', '打铁花是中国古代匠师们在铸造器皿过程中发现的一种民俗文化表演技艺，始于北宋，盛于明清，至今已有千余年历史。打铁花多流传于黄河中下游，以河南、山西最为流行，开封打铁花更被誉为黄河流域十大民间艺术之首。打铁花表演时，在一处空旷场地搭出六米高的双层花棚，棚上密布新鲜柳枝，上面绑满烟花鞭炮和起货等，棚中间竖立一根六米高的老杆，使花棚总高度达到十米以上。旁边设一熔炉化铁汁，十余名表演者轮番用花棒将千余度高温的铁汁击打到棚上，形成十几米高的铁花，铁花又点燃烟花鞭炮，再配上“龙穿花”的表演，场景蔚为壮观，呈现出惊险刺激、喜庆热闹的特点。', 7, '0', NULL, '', '', '', '', '', '', NULL, NULL, NULL, 'N', 5, 264, 896, '675077', '2026-01-20 09:25:31', '', NULL);
