INSERT INTO `biz_question` VALUES (109, 'judgment', '我们可以使用“记事本”软件编写HTML代码，保存时将后缀名改为.html即可用浏览器打开。', 8, '0', 1, '', '', '', '', 'T', '', NULL, NULL, NULL, 'N', NULL, NULL, 104, '19157727791', '2026-01-20 12:56:57', '', NULL);
INSERT INTO `biz_question` VALUES (110, 'typing', '互联网应用极大改变了我们的生活方式，从在线学习到电子支付，数据早已无处不在。网页是互联网数据呈现的重要载体，而超文本标记语言HTML则是制作网页的基石。在HTML代码中，标签通常成对出现，例如BODY标签定义了网页的主体内容，IMG标签用于插入图像。我们在享受便捷的同时，绝不能忽视网络安全隐患。为了保护个人隐私和数据资产，我们需要养成定期备份数据的习惯。', 8, '0', 1, '', '', '', '', '', '', NULL, NULL, NULL, 'N', 4, 178, 104, '19157727791', '2026-01-20 12:56:57', '', NULL);
INSERT INTO `biz_question` VALUES (111, 'typing', '核心知识点：控制形态主要分为人工干预控制和自动控制。人工干预控制需人直接或全程干预，如手动控制电灯开关；自动控制无需人参与即可实现目标，如感应灯自动亮灭。两者核心区别在于，输出量能否返回输入端与输入量比较，形成闭合环路。', 6, '1', 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Y', 5, 110, 104, '19157727791', '2026-01-20 13:01:00', '', NULL);
