INSERT INTO `sys_oper_log` VALUES (473, '题库管理', 1, 'com.ruoyi.business.controller.BizQuestionController.add()', 'POST', 1, '19157727791', '大徐小学', '/business/question', '127.0.0.1', '内网IP', '{\"createBy\":\"19157727791\",\"createTime\":\"2026-01-19 10:44:05\",\"creatorId\":104,\"grade\":8,\"isPublic\":\"Y\",\"lessonNum\":1,\"params\":{},\"questionContent\":\"1956 年美国达特茅斯会议正式提出 “人工智能（AI）” 概念，该年被视为人工智能元年。英国数学家阿兰・图灵在《计算机器与智能》中提出 “图灵测试”，以提问者判断失误率≥30% 作为机器具备人类智能的标准。人工智能发展并非一帆风顺，经历了三起两落的历程，不同阶段核心研究方向从符号推理逐步拓展。我国自 1978 年将 “智能模拟” 纳入国家研究计划，2015 年后将人工智能纳入 “互联网 +” 战略，在多个领域取得突破性成果。作为智慧社会核心技术，人工智能正深刻改变人类学习、生活和工作方式，成为全球重点发展的核心技术。\",\"questionId\":68,\"questionType\":\"typing\",\"scoringItems\":[],\"semester\":\"1\",\"typingDuration\":5,\"wordCount\":249}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2026-01-19 10:44:05', 22);
