INSERT INTO `sys_oper_log` VALUES (522, '课程设计与指派', 1, 'com.ruoyi.business.controller.BizLessonController.saveAll()', 'POST', 1, '675077', '塔山中学', '/business/lesson/save-all', '127.0.0.1', '内网IP', '{\"assignedClassCodes\":[\"1班\",\"3班\",\"4班\",\"5班\",\"6班\",\"7班\",\"8班\",\"9班\",\"10班\",\"2班\"],\"grade\":7,\"lessonId\":30,\"lessonNum\":1,\"lessonTitle\":\"测试\",\"params\":{},\"questions\":[{\"answer\":\"\",\"optionA\":\"\",\"optionB\":\"\",\"optionC\":\"\",\"optionD\":\"\",\"orderNum\":1,\"params\":{},\"questionContent\":\"打铁花是中国古代匠师们在铸造器皿过程中发现的一种民俗文化表演技艺，始于北宋，盛于明清，至今已有千余年历史。打铁花多流传于黄河中下游，以河南、山西最为流行，开封打铁花更被誉为黄河流域十大民间艺术之首。打铁花表演时，在一处空旷场地搭出六米高的双层花棚，棚上密布新鲜柳枝，上面绑满烟花鞭炮和起货等，棚中间竖立一根六米高的老杆，使花棚总高度达到十米以上。旁边设一熔炉化铁汁，十余名表演者轮番用花棒将千余度高温的铁汁击打到棚上，形成十几米高的铁花，铁花又点燃烟花鞭炮，再配上“龙穿花”的表演，场景蔚为壮观，呈现出惊险刺激、喜庆热闹的特点。\",\"questionId\":102,\"questionScore\":70,\"questionType\":\"typing\",\"scoringItems\":[],\"typingDuration\":5,\"wordCount\":264},{\"answer\":\"A\",\"optionA\":\"五星红旗\",\"optionB\":\"星条旗\",\"optionC\":\"米字旗\",\"optionD\":\"枫叶旗\",\"orderNum\":2,\"params\":{},\"questionContent\":\"【选择题】中国的国旗是什么？\",\"questionId\":82,\"questionScore\":2,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"B\",\"optionA\":\"圣诞节\",\"optionB\":\"端午节\",\"optionC\":\"万圣节\",\"optionD\":\"感恩节\",\"orderNum\":3,\"params\":{},\"questionContent\":\"【选择题】下列哪个是中国的传统节日？\",\"questionId\":83,\"questionScore\":2,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"C\",\"optionA\":\"月亮\",\"optionB\":\"火星\",\"optionC\":\"太阳\",\"optionD\":\"木星\",\"orderNum\":4,\"params\":{},\"questionContent\":\"【选择题】地球围绕什么天体公转？\",\"questionId\":84,\"questionScore\":2,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"C\",\"optionA\":\"鸡\",\"optionB\":\"蛇\",\"optionC\":\"鲸鱼\",\"optionD\":\"鲤鱼\",\"orderNum\":5,\"params\":{},\"questionContent\":\"【选择题】下列哪种动物是哺乳动物？\",\"questionId\":85,\"questionScore\":2,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"B\",\"optionA\":\"唐朝\",\"optionB\":\"秦朝\",\"optionC\"