INSERT INTO `sys_oper_log` VALUES (528, '课程设计与指派', 1, 'com.ruoyi.business.controller.BizLessonController.saveAll()', 'POST', 1, '19157727791', '大徐小学', '/business/lesson/save-all', '127.0.0.1', '内网IP', '{\"assignedClassCodes\":[\"2班\",\"4班\",\"6班\",\"7班\"],\"grade\":8,\"lessonId\":31,\"lessonNum\":1,\"lessonTitle\":\"2-考试\",\"params\":{},\"questions\":[{\"answer\":\"\",\"optionA\":\"\",\"optionB\":\"\",\"optionC\":\"\",\"optionD\":\"\",\"orderNum\":1,\"params\":{},\"questionContent\":\"互联网应用极大改变了我们的生活方式，从在线学习到电子支付，数据早已无处不在。网页是互联网数据呈现的重要载体，而超文本标记语言HTML则是制作网页的基石。在HTML代码中，标签通常成对出现，例如BODY标签定义了网页的主体内容，IMG标签用于插入图像。我们在享受便捷的同时，绝不能忽视网络安全隐患。为了保护个人隐私和数据资产，我们需要养成定期备份数据的习惯。\",\"questionId\":110,\"questionScore\":40,\"questionType\":\"typing\",\"scoringItems\":[],\"typingDuration\":4,\"wordCount\":178},{\"answer\":\"C\",\"optionA\":\"<body>...</body>\",\"optionB\":\"<p>...</p>\",\"optionC\":\"<title>...</title>\",\"optionD\":\"<h1>...</h1>\",\"orderNum\":2,\"params\":{},\"questionContent\":\"如果要在网页标题栏显示“期末考试”，代码应写在哪个标签之间？\",\"questionId\":108,\"questionScore\":10,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"B\",\"optionA\":\"<head>\",\"optionB\":\"<body>\",\"optionC\":\"<title>\",\"optionD\":\"<html>\",\"orderNum\":3,\"params\":{},\"questionContent\":\"在HTML网页代码中，用于定义网页“主体内容”的标签是？\",\"questionId\":104,\"questionScore\":10,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"A\",\"optionA\":\"<img>\",\"optionB\":\"<pic>\",\"optionC\":\"<image>\",\"optionD\":\"<src>\",\"orderNum\":4,\"params\":{},\"questionContent\":\"想要在网页中插入一张图片，应该使用以下哪个标签？\",\"questionId\":105,\"questionScore\":10,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"D\",\"optionA\":\"HTML标签通常是成对出现的\",\"optionB\":\"<br>标签用于换行，它没有结束标签\",\"optionC\":\"HTML是不区分大小写的\",\"optionD\":\"<html>标签表示网页的结束\",\"orderNum\":5,\"params\":{},\"questionContent\":\"下列关于HTML标签的说法，错误的是？\",\"questionId\":106,\"questionScore\":10,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"C\",\"op