INSERT INTO `sys_oper_log` VALUES (540, '课程设计与指派', 1, 'com.ruoyi.business.controller.BizLessonController.saveAll()', 'POST', 1, 'yelaoshi', '大目湾学校(初中部)', '/business/lesson/save-all', '127.0.0.1', '内网IP', '{\"assignedClassCodes\":[\"2班\",\"4班\",\"6班\",\"7班\",\"8班\"],\"grade\":8,\"lessonId\":31,\"lessonNum\":1,\"lessonTitle\":\"2-考试\",\"params\":{},\"questions\":[{\"answer\":\"\",\"lessonId\":31,\"optionA\":\"\",\"optionB\":\"\",\"optionC\":\"\",\"optionD\":\"\",\"orderNum\":1,\"params\":{},\"questionContent\":\"互联网应用极大改变了我们的生活方式，从在线学习到电子支付，数据早已无处不在。网页是互联网数据呈现的重要载体，而超文本标记语言HTML则是制作网页的基石。在HTML代码中，标签通常成对出现，例如BODY标签定义了网页的主体内容，IMG标签用于插入图像。我们在享受便捷的同时，绝不能忽视网络安全隐患。为了保护个人隐私和数据资产，我们需要养成定期备份数据的习惯。\",\"questionId\":110,\"questionScore\":35,\"questionType\":\"typing\",\"scoringItems\":[],\"typingDuration\":4,\"wordCount\":178},{\"filePath\":\"/profile/upload/2026/01/20/课后作业_20260120130453A040.docx\",\"lessonId\":31,\"orderNum\":2,\"params\":{},\"previewPath\":\"/profile/upload/2026/01/20/课后作业_20260120130453A040.pdf\",\"questionContent\":\"操作题\",\"questionId\":112,\"questionScore\":30,\"questionType\":\"practical\",\"scoringItems\":[{\"itemId\":16,\"itemName\":\"答案是否正确\",\"itemScore\":100,\"orderNum\":0,\"params\":{},\"questionId\":112}]},{\"answer\":\"C\",\"lessonId\":31,\"optionA\":\"<body>...</body>\",\"optionB\":\"<p>...</p>\",\"optionC\":\"<title>...</title>\",\"optionD\":\"<h1>...</h1>\",\"orderNum\":3,\"params\":{},\"questionContent\":\"如果要在网页标题栏显示“期末考试”，代码应写在哪个标签之间？\",\"questionId\":108,\"questionScore\":5,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"B\",\"lessonId\":31,\"optionA\":\"<head>\",\"optionB\":\"<body>\",\"optionC\":\"<title>\",\"optionD\":\"<html>\",\"orderNum\":4,\"params\":{},\"questionContent\":\"在HTML网页代码中，用于定义网页“主体内容”的标签是？\",\"questionId\":104,\"questionScore\":5,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"A\",\"lessonId\":31,\"optionA\":\"<img>\",\"optionB\":\"<pic>\",\"optionC\":\"<image>\",\"optionD\":\"<src>\",\"ord