INSERT INTO `sys_oper_log` VALUES (565, '课程设计与指派', 1, 'com.ruoyi.business.controller.BizLessonController.saveAll()', 'POST', 1, '19157727791', '大徐小学', '/business/lesson/save-all', '127.0.0.1', '内网IP', '{\"assignedClassCodes\":[\"8班\"],\"grade\":6,\"lessonId\":23,\"lessonNum\":1,\"lessonTitle\":\"自动控制系统\",\"params\":{},\"questions\":[{\"lessonId\":23,\"orderNum\":1,\"params\":{},\"questionContent\":\"核心知识点：控制形态主要分为人工干预控制和自动控制。人工干预控制需人直接或全程干预，如手动控制电灯开关；自动控制无需人参与即可实现目标，如感应灯自动亮灭。两者核心区别在于，输出量能否返回输入端与输入量比较，形成闭合环路。\",\"questionId\":111,\"questionScore\":30,\"questionType\":\"typing\",\"scoringItems\":[],\"typingDuration\":5,\"wordCount\":110},{\"filePath\":\"/profile/upload/2026/01/21/考试操作题_20260121124339A213.docx\",\"lessonId\":23,\"orderNum\":2,\"params\":{},\"previewPath\":\"/profile/upload/2026/01/21/考试操作题_20260121124339A213.pdf\",\"questionContent\":\"六年级\",\"questionId\":118,\"questionScore\":20,\"questionType\":\"practical\",\"scoringItems\":[{\"itemId\":17,\"itemName\":\"答案是否正确\",\"itemScore\":100,\"orderNum\":0,\"params\":{},\"questionId\":118}]},{\"answer\":\"C\",\"lessonId\":23,\"optionA\":\"顺序结构\",\"optionB\":\"分支结构\",\"optionC\":\"循环结构\",\"optionD\":\"选择结构\",\"orderNum\":3,\"params\":{},\"questionContent\":\"猜数字游戏中，用于反复让用户输入的结构是\",\"questionId\":115,\"questionScore\":10,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"B\",\"lessonId\":23,\"optionA\":\"排序法 \",\"optionB\":\"枚举法\",\"optionC\":\"加密法\",\"optionD\":\"压缩\",\"orderNum\":4,\"params\":{},\"questionContent\":\"在“鸡兔同笼”问题中，常用的算法思想是\",\"questionId\":114,\"questionScore\":10,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"B\",\"lessonId\":23,\"optionA\":\"随意性\",\"optionB\":\"有限性\",\"optionC\":\"娱乐性\",\"optionD\":\"模糊性\",\"orderNum\":5,\"params\":{},\"questionContent\":\"下列哪一项属于算法的基本特征？\",\"questionId\":113,\"questionScore\":10,\"questionType\":\"choice\",\"scoringItems\":[]},{\"answer\":\"F\",\"lessonId\":23,\"orderNum\":6,\"params\":{},\"questionContent\":\"二分查找比顺序查找效率低\",\"ques